}

const App = () => {
  return (
    <NavigationContainer>

          <Stack.Navigator
            initialRouteName="LoginScreen"
            screenOptions={{
              headerShown: false,
            }}
          >
            <Stack.Screen
              name="LoginScreen"
              component={LoginScreen} />

          </Stack.Navigator>

    </NavigationContainer>
  )
}

export default App;
